#define NNOM_MODEL_VERSION (10000*0 + 100*4 + 3)

/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[8];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(rnn_s(lstm_cell_s(&lstm_lstm_cell_config), &lstm_config), layer[0]);
	layer[2] = model.hook(flatten_s(&flatten_config), layer[1]);
	layer[3] = model.hook(dense_s(&dense_config), layer[2]);
	layer[4] = model.hook(dense_s(&dense_1_config), layer[3]);
	layer[5] = model.hook(dense_s(&dense_2_config), layer[4]);
	layer[6] = model.hook(softmax_s(&softmax_config), layer[5]);
	layer[7] = model.hook(output_s(&output0_config), layer[6]);
	model_compile(&model, layer[0], layer[7]);
	return &model;
}
